import React from 'react';
import styled from 'styled-components';

function SearchBody() {
	return (
		<ComponentWrapper>
			<div className="Search_sectionContainer__UaVWv">
				<h2 className="Search_searchLabel__fOBpt">
					연관 직무<span>1</span>
				</h2>
				<div className="CategoryTags_tagBar__52K3J">
					<a
						href="/wdlist/518/669"
						className="CategoryTags_tagItem__cN5tk"
						aria-label=""
						target="_blank"
						rel="noopener noreferrer"
					>
						프론트엔드 개발자
					</a>
				</div>
			</div>
			<div className="Search_sectionContainer__UaVWv">
				<h2 className="Search_searchLabel__fOBpt">
					회사<span>2</span>
				</h2>
				<div className="CompanyList_className__onSYS">
					<div className="slick-slider slick-initialized">
						<div className="slick-list">
							<div
								className="slick-track"
								style={{
									width: `1080px`,
									opacity: `1`,
									transform: `translate3d(0px, 0px, 0px)`,
								}}
							>
								<div
									data-index="0"
									className="slick-slide slick-active slick-current"
									tabIndex="-1"
									aria-hidden="false"
									style={{ outline: `none`, width: `1080px` }}
								>
									<div>
										<a
											href="/company/13122"
											className="CompanyItem_className__lzn3X"
											aria-label=""
											data-attribute-id="company__click"
											data-company-id="13122"
											data-company-name="캐롯아이"
										>
											<div className="CompanyItem_logoGroup__ugDSt">
												<div
													className="CompanyItem_logoClassName__UTrBh"
													style={{
														backgroundImage: `url("https://static.wanted.co.kr/images/wdes/0_5.57a3e694.png")`,
													}}
												/>
												<div className="CompanyItem_textClassName__Dxods">
													<h5>캐롯아이</h5>
													<h6>IT, 컨텐츠</h6>
												</div>
											</div>
											<button
												type="button"
												className="Button_Button__root__V1ie3 Button_Button__outlined__H2mkd undefined Button_Button__sizeMedium__k0A1w CompanyItem_buttonDefault__r02xH"
											>
												<span className="Button_Button__label__1Kk0v">
													팔로우
												</span>
											</button>
										</a>
										<a
											href="/company/22204"
											className="CompanyItem_className__lzn3X"
											aria-label=""
											data-attribute-id="company__click"
											data-company-id="22204"
											data-company-name="페이브"
										>
											<div className="CompanyItem_logoGroup__ugDSt">
												<div
													className="CompanyItem_logoClassName__UTrBh"
													style={{
														backgroundImage: `url("https://static.wanted.co.kr/images/wdes/0_5.75c9f4ea.png")`,
													}}
												/>
												<div className="CompanyItem_textClassName__Dxods">
													<h5>페이브</h5>
													<h6>IT, 컨텐츠</h6>
												</div>
											</div>
											<button
												type="button"
												className="Button_Button__root__V1ie3 Button_Button__outlined__H2mkd undefined Button_Button__sizeMedium__k0A1w CompanyItem_buttonDefault__r02xH"
											>
												<span className="Button_Button__label__1Kk0v">
													팔로우
												</span>
											</button>
										</a>
									</div>
									<div />
									<div />
								</div>
							</div>
						</div>
					</div>
				</div>
			</div>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	margin: 60px auto 80px;
	width: 87.72%;
	position: relative;
	max-width: 1060px;
	.Search_sectionContainer__UaVWv {
		padding-bottom: 60px;
	}
	.Search_searchLabel__fOBpt {
		font-size: 24px;
		font-weight: 600;
		line-height: 36px;
		margin-bottom: 18px;
		color: #333;
		> span {
			margin-left: 10px;
			font-weight: 400;
		}
	}
	.CategoryTags_tagBar__52K3J {
		position: relative;
		width: 100%;
		text-align: left;
		.CategoryTags_tagItem__cN5tk {
			display: inline-block;
			background-color: #fff;
			text-align: center;
			padding: 0 18px;
			height: 40px;
			line-height: 40px;
			border: 1px solid #e1e2e3;
			border-radius: 20px;
			font-size: 16px;
			font-weight: 400;
			color: #333;
			margin: 0 6px 6px 0;
			font-family: inherit;
		}
	}
	.Search_searchLabel__fOBpt {
		font-size: 24px;
		font-weight: 600;
		line-height: 36px;
		margin-bottom: 18px;
		color: #333;
	}
	.CompanyList_className__onSYS {
		margin: -10px;
		position: relative;
		-ms-overflow-style: none;
		scrollbar-width: none;
	}
`;

export default SearchBody;
